import Card from "../card/Card";
import "./episodesComponent.scss";

const EpisodesComponent = () => {
  return (
    <div className="c-episodes h-component">
      <h3 className="c-title">Episodes</h3>
      <Card />
    </div>
  );
};

export default EpisodesComponent;
